import  "../../../util";
import ReturnIcon from "./img/returnIcon.png"
import RefreshIcon from "./img/refreshIcon.png"
import WholeIcon from "./img/wholeIcon.png"
import TitleDropDown from "./TitleDropDown1.js"
import "./Title.css"

export default class TitleCompent extends PureComponent {
    constructor(props) {
        super(props);
        this.state = {
			
        };
    }
	
	
	
	
	
	
    render() {
        return (
            <div id="title">
				<div className="icon">
					<img src={ReturnIcon}/>
					<img src={RefreshIcon}/>
					<img src={WholeIcon}/>
				</div>
				<div className="menue">
					<TitleDropDown options={[{value:'能耗计量'},{value:'楼宇自控'},{value:'警报故障管理'}]}> </TitleDropDown>
				</div>	
            </div>
        );
    }
}
